import React from 'react';

// IMAGES
import androidImage from '../../assets/Application/android.png';
import iPhoneImage from '../../assets/Application/iphone.png';

// CSS
import classes from './Application.module.css';

// Component
const Application = () => (
    <div className={classes.Application}>
        <div className={classes.backgroundImage}>
            <div className={classes.iPhone}>
                <img src={iPhoneImage} alt="iPhone Image"/>
            </div>
            <div className={classes.android}>
                <img src={androidImage} alt="Android Image"/>
            </div>
        </div>
    </div>
);

// Export
export default Application;
